import React from 'react';
import './App.css';

import Table from './components/Table';
import { dataPlanets } from './services/data';
import {Provider} from 'react-redux';

function App() {
  return (
    <Provider>
      <div className="App">
        <header className="App-header">
          <Table />
          <div>{dataPlanets}</div>
        </header>
      </div>
    </Provider>
  );
}

export default App;
